import React, { Component } from "react";
//import * as actions from "../../actions";
import { fetchRentalsById } from "../../actions";
import { connect } from "react-redux";
import Spinner from "../Spinner/Spinner";
import RentalInfo from "./RentalInfo";

class RentalDetail extends Component {
  componentDidMount() {
    const rentalId = this.props.match.params.id;
    this.props.fetchRentalsById(rentalId);
  }

  render() {
    const { rental } = this.props;
    let content;
    if (rental === null) {
      content = <Spinner />;
    } else {
      content = (
        // <div>
        //   Details rental title
        //   <h1>{rental.title}</h1>
        //   <h1>{rental.country}</h1>
        //   <h1>{rental.description}</h1>
        //   <h1>{rental.dailyRate}</h1>
        // </div>
        <section className="RentalDetail">
          <div className="upper-section">
            <div className="row">
              <div className="col-md-6">
                <h1>
                  {rental.title}/{rental.category}
                </h1>
                <img src={rental.image} alt="" />
              </div>
              <div className="col-md-6">
                <img src={rental.image} alt="" />
              </div>
            </div>
          </div>

          <div className="lower-section">
            <div className="row">
              <div className="col-md-8">
                <RentalInfo rental={rental} />
              </div>
              <div className="col-md-4"></div>
            </div>
          </div>
        </section>
      );
    }
    return <div>{content}</div>;
  }
}

const mapStateToProps = state => {
  return {
    rental: state.rental.rental
  };
};

export default connect(mapStateToProps, { fetchRentalsById })(RentalDetail);
